import React from 'react';

const Navbar = () => {
    return (
        <div className='flex flex-col md:flex-row justify-end items-center bg-green-600 w-full h-20'>
            <ul className='flex flex-row gap-5 px-14 items-center text-white text-s'>
                <li className='hover:text-gray-500'>
                    Home
                </li>
                <li>
                    About
                </li>
                <li>
                    Sing
                </li>
                <li>
                    Login
                </li>


            </ul>
        </div>
    );
}

export default Navbar;
